import React from 'react';
import { BrowserRouter as Router, Routes, Route, Link } from 'react-router-dom';
import PostList from './components/PostList';
import PostDetail from './components/PostDetail';
import PostForm from './components/PostForm';
import styles from './App.module.css';

function App() {
  return (
    <Router>
      <div className={styles.App}>
        <header style={{backgroundColor: '#00704A', color: 'white', padding: '20px', textAlign: 'center'}}>
          <h1>Starbucks Blogs</h1>
          <nav>
            <ul style={{listStyleType: 'none', padding: 0}}>
              <li style={{display: 'inline', marginRight: '20px'}}><Link to="/" style={{color: 'white', textDecoration: 'none'}}>Home</Link></li>
              <li style={{display: 'inline', marginRight: '20px'}}><Link to="/new" style={{color: 'white', textDecoration: 'none'}}>Create New Post</Link></li>
            </ul>
          </nav>
        </header>
        <main style={{padding: '20px'}}>
          <Routes>
            <Route path="/" element={<PostList />} />
            <Route path="/post/:id" element={<PostDetail />} />
            <Route path="/new" element={<PostForm />} />
            <Route path="/edit/:id" element={<PostForm />} />
          </Routes>
        </main>
        <footer style={{textAlign: 'center', marginTop: '40px', padding: '20px', backgroundColor: '#f0f0f0'}}>
          <p>&copy; 2023 Starbucks Blogs. All rights reserved.</p>
        </footer>
      </div>
    </Router>
  );
}

export default App;
